					<text transform="matrix(1 0 0 1 70.4911 88.9903)" class="st0 st1 st2">La historia del mole se remonta a la </text>
					<text transform="matrix(1 0 0 1 464.9911 88.9903)" class="st0 st3 st2">época </text>
					<text transform="matrix(1 0 0 1 70.4911 115.3903)" class="st0 st3 st2">prehispánica</text>
					<text transform="matrix(1 0 0 1 222.8911 115.3903)" class="st0 st1 st2">. Se narra que los aztecas </text>
					<text transform="matrix(1 0 0 1 70.4911 141.7903)" class="st0 st1 st2">preparaban para los</text>
					<text transform="matrix(1 0 0 1 294.7911 141.7903)" class="st0 st3 st2"> grandes señores</text>
					<text transform="matrix(1 0 0 1 489.8911 141.7903)" class="st0 st1 st2"> un </text>
					<text transform="matrix(1 0 0 1 70.4911 168.1903)" class="st0 st1 st2">platillo complejo llamado &quot;molli&quot;, que </text>
					<text transform="matrix(1 0 0 1 70.4911 194.5903)" class="st0 st1 st2">significa salsa. Los primeros moles </text>
					<text transform="matrix(1 0 0 1 70.4911 220.9903)" class="st0 st1 st2">carecieron de chocolate, por lo que no se le </text>
					<text transform="matrix(1 0 0 1 70.4911 247.3903)" class="st0 st1 st2">puede ubicar como una salsa de chocolate.</text>
					<text transform="matrix(1 0 0 1 544.7911 247.3903)" class="st0 st1 st2 st4">​</text>
					<text transform="matrix(1 0 0 1 544.7911 247.3903)" class="st0 st1 st2"> </text>
					<text transform="matrix(1 0 0 1 70.4911 273.7903)" class="st0 st1 st2">El plato empleaba en sus primeras versiones </text>
					<text transform="matrix(1 0 0 1 70.4911 300.1903)" class="st0 st1 st2">carne de guajolote, chocolate y chile.</text>
					<text transform="matrix(1 0 0 1 70.4911 352.9903)" class="st0 st1 st2">Existen más de 300 tipos de moles en México.</text>
					<text transform="matrix(1 0 0 1 429.5911 379.3903)" class="st0 st1 st2">. </text>
					<text transform="matrix(1 0 0 1 442.4911 379.3903)" class="st0 st1 st2 st4">​</text>
				</g>
			</g>
		</g>
	</g>
